import React, {Component} from 'react';
import './App.css';
import SearchForm from './SearchForm.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
            <h2>Camp Butterfly</h2>
        </header>
        <SearchForm />
      </div>
    );
  }
}

export default App;
